import './BeautyEffect.style.css';

const BeautyEffectPage = () => (
    <div className='beautyEffectHeader-container'>

        <div className='beautyEffectPage-content-container'>
            <ShopAllMenu />
            <BeautyEffectCollection />
        </div>
